def generate_lexicographically_smallest_string(n: int, k: int) -> str:
    if k > n or (k == 1 and n > 1):
        return '-1'
    if k == 1:
        return 'a'
    letters = ['a', 'b', 'c', 'd', 'e', 'f', 'g', 'h', 'i', 'j', 'k', 'l', 'm', 'n', 'o', 'p', 'q', 'r', 's', 't', 'u', 'v', 'w', 'x', 'y', 'z']
    s = ''
    for i in range(2, k):
        s += letters[i]
    n += k - 2
    result = 'ab' * (n // 2)
    if n % 2 != 0:
        result += 'a'
    return result + s

